// dependancies 
import React from 'react';
import './App.css';
// redux
import {Provider} from "react-redux";
import store from "./store";

// chat component
// connect app to redux 
const App = () => {
  return (
    <Provider store={store}>
      <div className="App">
          Hello World!
      </div>
    </Provider>
  );
}

export default App;
